root['/untitled_entry'].attrs['EX_doc'] = '    .. index:: NXcanSAS (applications); SASentry              Place the canSAS ``SASentry`` group as a child of a NeXus ``NXentry`` group       (when data from multiple techniques are being stored)       or as a replacement for the ``NXentry`` group.         Note: It is required for all numerical objects to provide       a *units* attribute that describes the engineering units.        Use the Unidata UDunits [#]_ specification        as this is compatible with various community standards.              .. [#] The UDunits specification also includes instructions for derived units.   '
root['/untitled_entry/definition'].attrs['EX_doc'] = '     Official NeXus NXDL schema to which this subentry conforms.    '
root['/untitled_entry/untitled_data'].attrs['EX_doc'] = '     A *SASData* group contains a single reduced small-angle scattering data set          that can be represented as :math:`I(\vec{Q})` or :math:`I(|\vec{Q}|)`.                  *Q* can be either a vector (:math:`\vec{Q}`) or a vector magnitude (:math:`|\vec{Q}|`)                  The name of each *SASdata* group must be unique within a SASentry group.           Suggest using names such as ``sasdata01``.                  NOTE:  For the first *SASdata* group, be sure to write the chosen name          into the `SASentry/@default` attribute, as in::                      SASentry/@default="sasdata01"                  A *SASdata* group has several attributes:                  * I_axes         * Q_indices         * Mask_indices                  To indicate the dependency relationships of other varied parameters,          use attributes similar to ``@Mask_indices`` (such as ``@Temperature_indices``         or ``@Pressure_indices``).    '
root['/untitled_entry/untitled_data/Q'].attrs['EX_doc'] = '      .. index:: NXcanSAS (applications); Q                         Array of :math:`Q` data to accompany :math:`I`.                      .. figure:: canSAS/Q-geometry.jpg            :width: 60%                       The :math:`\vec{Q}` geometry.            (:download:`full image <canSAS/Q-geometry.jpg>`)                      :math:`Q` may be represented as either           the three-dimensional scattering vector :math:`\vec{Q}`           or the magnitude of the scattering vector, :math:`|\vec{Q}|`.                      .. math::  |\vec{Q}| = (4\pi/\lambda) sin(\theta)                       When we write :math:`Q`, we may refer to either or both of            :math:`|\vec{Q}|`            or :math:`\vec{Q}`,  depending on the context.     '
root['/untitled_entry/untitled_data/I'].attrs['EX_doc'] = '      .. index:: NXcanSAS (applications); I                         Array of intensity (:math:`I`) data.                      The intensity may be represented in one of these forms:                      **absolute units**: :math:`d\Sigma/d\Omega(Q)`           differential cross-section           per unit volume per unit solid angle (such as: 1/cm/sr or 1/m/sr)                      **absolute units**: :math:`d\sigma/d\Omega(Q)`           differential cross-section           per unit atom per unit solid angle (such as: cm^2 or m^2)                      **arbitrary units**: :math:`I(Q)`           usually a ratio of two detectors            but units are meaningless (such as: a.u. or counts)                      This presents a few problems            for analysis software to sort out when reading the data.           Fortunately, it is possible to analyze the *units* to determine which type of           intensity is being reported and make choices at the time the file is read. But this is           an area for consideration and possible improvement.                      One problem arises with software that automatically converts data into some canonical           units used by that software. The software should not convert units between these different           types of intensity indiscriminately.                      A second problem is that when arbitrary units are used, then the set of possible           analytical results is restricted.  With such units, no meaningful volume fraction            or number density can be determined directly from :math:`I(Q)`.                      In some cases, it is possible to apply a factor to convert the arbitrary            units to an absolute scale.  This should be considered as a possibility            of the analysis process.                      Where this documentation says *typical units*, it is possible that small-angle           data may be presented in other units and still be consistent with NeXus.           See the :ref:`design-units` section.     '
root['/untitled_entry/untitled_data/Idev'].attrs['EX_doc'] = '      .. index:: NXcanSAS (applications); Idev                      Estimated **uncertainty** (usually standard deviation)           in :math:`I`.  Must have the same units as :math:`I`.            When present, the name of this field is also            recorded in the *uncertainties* attribute of *I*, as in::                          I/@uncertainties="Idev"     '
root['/untitled_entry/untitled_data/Qdev'].attrs['EX_doc'] = '      .. index:: NXcanSAS (applications); Qdev                      Estimated :math:`Q` **resolution** (usually standard deviation).             Must have the same units as :math:`Q`.                      When present, the name of this field is also            recorded in the *resolutions* attribute of *Q*,            as in::                          Q/@resolutions="Qdev"            or::                Q/@resolutions="dQw", "dQl"     '
root['/untitled_entry/untitled_data/dQw'].attrs['EX_doc'] = '      .. index:: NXcanSAS (applications); dQw                      :math:`Q` **resolution** along the axis of scanning            (the high-resolution *slit width* direction).            Useful for defining resolution data from            slit-smearing instruments such as Bonse-Hart geometry.           Must have the same units as :math:`Q`.                      When present, the name of this field is also            recorded in the *resolutions* attribute of *Q*,            as in::                          Q/@resolutions="dQw", "dQl"     '
root['/untitled_entry/untitled_data/dQl'].attrs['EX_doc'] = '      .. index:: NXcanSAS (applications); dQl                      :math:`Q` **resolution** perpendicular to the axis of scanning            (the low-resolution *slit length* direction).            Useful for defining resolution data from            slit-smearing instruments such as Bonse-Hart geometry.           Must have the same units as :math:`Q`.                      When present, the name of this field is also            recorded in the *resolutions* attribute of *Q*,            as in::                          Q/@resolutions="dQw", "dQl"     '
root['/untitled_entry/untitled_data/Qmean'].attrs['EX_doc'] = '      Mean value of :math:`Q` for this data point.            Useful when describing data that has been            binned from higher-resolution data.                       It is expected that ``Q`` is provided            and that both ``Q`` and ``Qmean`` will have the same units.     '
